public int CalPoints(string[] operations) {
        Stack<int> stack = new Stack<int>();
        foreach (var s in operations)
        {
            if (s == "+")
            {
                int num1 = stack.Pop();
                int num2 = stack.Peek();
                stack.Push(num1);
                stack.Push(num1 + num2);
            }
            else if (s == "D")
            {

                int num1 = stack.Peek();
                stack.Push(2 * num1);
            }
            else if (s == "C")
            {

                stack.Pop();
            }
            else stack.Push(int.Parse(s));
        }
        int sum = 0;
        while (stack.Any())
        {
            sum += stack.Pop();
        }
        return sum;
    }
